import React from 'react'
import { StyleSheet, Text, View } from 'react-native';

const Header = () => {
    return (
        <div style={stylesHeader.containers}>
            This is Header!
        </div>
    )
}

export default Header


const stylesHeader = StyleSheet.create({
    containers: {
        backgroundColor: red,
        alignItems: 'center',
        justifyContent: 'center',
    },
});
